    account.  Ten thousand was then reattributed to his wife, Nancy Sorenson.  Six
    thousand was transferred to our non-federal account on 1/5/05, which can accept
    unlimited contributions from individuals.  A letter was sent to Darrin Sorenson
    on the date his check was received to advise him of how his deposit was split
    into our accounts and to offer him a chance for a refund.  According to AO 2001-17,
    the Commission has deemed it sufficient to deposit checks exceeding the federal
    limits into a federal account and then to make a transfer to the nonfederal account
    for the portion that exceeds the federal limit.  Therefore, the year-to-date aggregate
    totals reported for Darrin Sorenson on our report is a reflection of the federal
    portion of the donor's contributions to date."
