  input: TEXT,SA11B,SA11B.55876,"This entry is to correct our cash balance from errors
    that were found in the June 2003 Monthly Report and the October 2003 Monthly Report.  These
    reports have been amended to correct the errors.  In May 2003 the IRSCC realized
    it would have employees who would need to be paid from federal funds due to FEA
    activity.  Our payroll company incorrectly took these wages totaling $39,232.48
    out of our non-federal account.  However, these payroll entries were reported
    on the June 2003 report.  In June 2003 the IRSCC made transfers from the federal
    account to the non-federal account to reimburse the non-federal account for the
    wages that were mistakenly taken out.  We subsequently reported these transfers
    on our July Monthly Report.  Therefore these amounts were reported twice and our
    cash balance incorrectly reported too low.  In September 2003 the IRSCC accidentally
    omitted two checks totaling $7,762.84 on the October Monthly Report.  By omitting
    these two contributions our cash balance again was reported too low.   I talked
    with Debbie Chacona, Branch Chief, on 3/17/06 and she recommended that I amend
    the two 2003 reports and then to add this entry to the beginning of 2005 to correct
    our cash for this election cycle.  I will be amending all subsequent 2005 and
    2006 reports to reflect the correct cash amount."
