    from the event.  After talking with my analyst on 1/26/05, I realized this expense
    should have been paid with 100% non-federal funds.  Since non-federal dollars
    had already been transferred to the federal account for the reimbursement of this
    H4 expense, we needed to transfer the full amount of the expenditure back to the
    non-federal account.  Therefore, this transfer of $174.90 on 1/26/05 was to reimburse
    our non-federal account for this expenditure."
